import React from 'react';
import Header from '../components/Header';
import DashboardCard from '../components/DashboardCard';
import { User, CalendarDays, CreditCard } from 'lucide-react';

const Dashboard = ({ onNavigate }) => {
  return (
    <div className="min-h-screen bg-gray-50">
      <Header />
      <div className="max-w-7xl mx-auto px-4 py-8">
        <div className="mb-8">
          <h2 className="text-3xl font-bold text-gray-900 mb-2">Dashboard</h2>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          <DashboardCard icon={User} label="Clients" onClick={() => onNavigate('clients')} />
          <DashboardCard icon={CalendarDays} label="Appointments" onClick={() => onNavigate('appointments')} />
          <DashboardCard icon={CreditCard} label="Payments" onClick={() => onNavigate('payments')} />
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
